import React from 'react';
import Header from './components/Header';
import Banner from './components/Banner';
import About from './components/About'; // Assuming About section is ready
import Empanelment from './components/BankLogos'; // Empanelment section
import Contact from './components/Contact'; // Contact section
import Footer from './components/Footer';


function App() {
  return (
    <div>
      <Header />
      <section id="banner">
        <Banner />
      </section>

      {/* Sections below the header */}
      <section id="about">
        <About />
      </section>

      <section id="empanelment">
        <Empanelment />
      </section>

      <section id="contact">
        <Contact />
      </section>

      <Footer /> {/* âœ… Add Footer component here */}
      <footer>
        {/* Your footer content */}
      </footer>
    </div>
  );
}

export default App;
